import React, { Component } from 'react';
import PropTypes from 'prop-types';
import base from '../../config/api.js';
let api = base.api();


class View extends Component {
    static propTypes = {
        match: PropTypes.object.isRequired,
        location: PropTypes.object.isRequired,
        history: PropTypes.object.isRequired
    };
    constructor(props) {
        super(props);
        this.state = {
            data: this.props.match.params.data,
            title: "All",
            data: ""
        };
    }

    getContent(data) {
        let report = kmom;

        fetch(api + `/data/view/${data}`)
            .then(res => res.json())
            .then(res => this.setState({
                data: res
            }));
    }
    render() {
        return (
            <main>
                <nav className="navbar_main under">
                    <ul>
                        <li><NavLink to="/view/data" activeClassName="selected">All</NavLink></li>
                    </ul>
                </nav>
                <h1>{ this.state.title }</h1>
            </main>
        );
    }
}

export default View;
